import "./Sidebar.css";
import React from "react";
import { Col, Row } from "react-bootstrap";
import { Link } from "react-scroll";

const Sidebar = ({}) => {
  return (
    <Col className="sidebar">
      <Row><Link className="nav-item"
            activeClass="active"
            to="education"
            spy={true}
            smooth={true}
            offset={-20}
            duration={500}>Education</Link></Row>
      <Row><Link>Experience</Link></Row>
      <Row><Link>Skills</Link></Row>
      <Row><Link>Achievements</Link></Row>
    </Col>
  );
};

export default Sidebar;
